intro:
Использую в работе микросервисную архитектуру и следующий стек технологий:• разработка: python 3.6+;• распределение работы: celery, rabbitmq, multiprocessing/threading, asynсio, backgroundtasks starlette;• контейнеризация: docker compose;• базы данных: postgres, redis, sqlalchemy;• применение ml: tensorflow, spacy;• сбор данных: requests, beatifulsoup, selenium;• обработка данных: stl, pandas, numpy;• взаимодействия: fastapi, http rest, amqp, tcp/udp, json, xml;• отладка и профилирование: flake8, pylint, mypy, cprofile;• тестирование: pytest, locust, postman, jmeter;• отчётность: git, confluence, jira, nexus;• автоматизация: gitlab ci, bash, ansible, pyinstaller.Мои основные навыки и достижения:• применял ООП, основные шаблоны (mvc, singleton, decorator, contex manager, iterator, dependecy injection, fsm и др.);• разрабатывал на python standard library 3.6+, смежных библиотеках, использовал конкурентность и параллелизм;• применял готовые модели ml для целей ner, суммаризации, классификации, сентимент-анализа, и др.;• хорошим знанием *nix систем, возможностей systemd, bash, основных команд;• разрабатывал bash скрипты и ansible ноутбуки для автоматизации рутинных задач;• самостоятельно разрабатывал проекты с нуля в микросервисной структуре fastapi + celery + rabbitmq + postgresql (orm) + pytest;• проектировал структуры баз данных для своих проектов, версионные миграции делал через sql-скрипты (или orm) + git;• создавал распределеные докеризированные приложения в docker-compose;• использовал tdd (тесты - кодирование - рефакторинг);• оптимизировал код и архитектуру своих проектов в ходе кодревью;• дорабатывал open source решения для коммерческого использования;• проектировал и реализовал rest api, интегрировался с внешними системами;• использовал pytest как средство для написания unit-тестов, фикстур и mock-ов;• использовал selenium + xpath +css-селекторы для майнинга ценных данных;• использовал beautifulsoup + универсальные парсеры для извлечения очищенных текстов новостей из rss-каналов;• системным сетевым программированием в linux;• agile-разработкой;• декомпозировал задачи, взаимодействовал с разработчиками по горизонтали, вел учет своих трудозатрат в jira;• создавал ci/cd pipelines для своих проектов в gitlab;• свободно разбирался в технической документации на английском языкеВ настоящее время осваиваю и применяю в текущей работе следующие технологии: k8s, docker swarm, prometheus, elk, graphql. знаком с технологиями: jenkins, allure, zabbix.p.s. на qt5, с++ программировал 3 года назадИспользую в работе микросервисную архитектуру и следующий стек технологий:
• разработка: python 3.6+;
• распределение работы: celery, rabbitmq, multiprocessing/threading, asynсio, backgroundtasks starlette;
• контейнеризация: docker compose;
• базы данных: postgres, redis, sqlalchemy;
• применение ml: tensorflow, spacy;
• сбор данных: requests, beatifulsoup, selenium;
• обработка данных: stl, pandas, numpy;
• взаимодействия: fastapi, http rest, amqp, tcp/udp, json, xml;
• отладка и профилирование: flake8, pylint, mypy, cprofile;
• тестирование: pytest, locust, postman, jmeter;
• отчётность: git, confluence, jira, nexus;
• автоматизация: gitlab ci, bash, ansible, pyinstaller.

Мои основные навыки и достижения:
• применял ООП, основные шаблоны (mvc, singleton, decorator, contex manager, iterator, dependecy injection, fsm и др.);
• разрабатывал на python standard library 3.6+, смежных библиотеках, использовал конкурентность и параллелизм;
• применял готовые модели ml для целей ner, суммаризации, классификации, сентимент-анализа, и др.;
• хорошим знанием *nix систем, возможностей systemd, bash, основных команд;
• разрабатывал bash скрипты и ansible ноутбуки для автоматизации рутинных задач;
• самостоятельно разрабатывал проекты с нуля в микросервисной структуре fastapi + celery + rabbitmq + postgresql (orm) + pytest;
• проектировал структуры баз данных для своих проектов, версионные миграции делал через sql-скрипты (или orm) + git;
• создавал распределеные докеризированные приложения в docker-compose;
• использовал tdd (тесты - кодирование - рефакторинг);
• оптимизировал код и архитектуру своих проектов в ходе кодревью;
• дорабатывал open source решения для коммерческого использования;
• проектировал и реализовал rest api, интегрировался с внешними системами;
• использовал pytest как средство для написания unit-тестов, фикстур и mock-ов;
• использовал selenium + xpath +css-селекторы для майнинга ценных данных;
• использовал beautifulsoup + универсальные парсеры для извлечения очищенных текстов новостей из rss-каналов;
• системным сетевым программированием в linux;
• agile-разработкой;
• декомпозировал задачи, взаимодействовал с разработчиками по горизонтали, вел учет своих трудозатрат в jira;
• создавал ci/cd pipelines для своих проектов в gitlab;
• свободно разбирался в технической документации на английском языке

В настоящее время осваиваю и применяю в текущей работе следующие технологии: k8s, docker swarm, prometheus, elk, graphql. знаком с технологиями: jenkins, allure, zabbix.

p.s. на qt5, с++ программировал 3 года назад


